import React from 'react'
import './App.css';
import Form from './Form.js'

function App() {
  return (
    <div className="App">
      <header className="App-header">       
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          <Form />
        </a>
      </header>
    </div>
  );
}

export default App;
